			c = p.clientHeight;		// 父元素当前长度
			d = doe.offsetHeight;		// 子元素当前长度
			s = doe.offsetTop;		// 子元素相对于父元素的位置
			if (t === "static") {
				s -= p.offsetTop + p.clientTop;
			}
			switch (vertical) {
				case "T":	// 靠上
				case "t":
					p.scrollTop = s - padding;
					break;
				case "C":	// 居中
				case "c":
					p.scrollTop = s + d/2 - c/2;
					break;
				case "B":	// 靠下
				case "b":
					p.scrollTop = s + d + padding - c;
					break;
			}
		}

		// 横向调整
