			c = p.clientWidth;		// 父元素当前长度
			d = doe.offsetWidth;		// 子元素当前长度
			s = doe.offsetLeft;		// 子元素相对于父元素的位置
			if (t === "static") {
				s -= p.offsetLeft + p.clientLeft;
			}
			switch (horizontal) {
				case "L":	// 靠左
				case "l":
					p.scrollLeft = s - padding;
					break;
